import React from "react";

function Task({ index, task }) {
  console.log("Task", index, task.name);
  return (
    <div>
      <h1>Task</h1>
      {Object.keys(task).map((key, index) => {
        return key + ":" + task[key];
      })}
    </div>
  );
}

export default Task;
